By far the easiest way to create a custom module is to call rhai::plugin::combine_with_exported_module! from within rhai::def_package! which simply merges in all the functions defined within a plugin module . In fact, this exactly is how Rhai's built-in packages, such as BasicMathPackage, are implemented. Because of the specific requirements of a package , all sub-modules are flattened (i.e. all functions defined within sub-modules are pulled up and registered at the top level instead) and so there will not be any sub-modules added to the package. Variables in the plugin module are ignored. // Import necessary types and traits.
use rhai::{ def_package, packages::Package, packages::{ArithmeticPackage, BasicArrayPackage, BasicMapPackage, LogicPackage}
};
use rhai::plugin::*; // Define plugin module.
#[export_module]
mod my_module { pub const MY_NUMBER: i64 = 42; pub fn greet(name: &str) -> String { format!("hello, {}!", name) } pub fn get_num() -> i64 { 42 } // This is a sub-module, but if using combine_with_exported_module!, it will // be flattened and all functions registered at the top level. pub mod my_sub_module { pub fn get_sub_num() -> i64 { 0 } }
} // Define the package 'MyPackage'.
def_package!(rhai:MyPackage:"My own personal super package", module, { // Aggregate existing packages simply by calling 'init' on each. ArithmeticPackage::init(module); LogicPackage::init(module); BasicArrayPackage::init(module); BasicMapPackage::init(module); // Merge all registered functions and constants from the plugin module into the custom package. // // The sub-module 'my_sub_module' is flattened and its functions registered at the top level. // // The text string name in the second parameter can be anything and is reserved for future use; // it is recommended to be an ID string that uniquely identifies the plugin module. // // The constant variable, 'MY_NUMBER', is ignored. // // This call ends up registering three functions at the top level of the package: // 1) greet // 2) get_num // 3) get_sub_num (pulled up from 'my_sub_module') // combine_with_exported_module!(module, "my-functions", my_module));
});

