mod my_module { // Always available pub fn func0() {} // The following sub-module is only available under 'feature1' #[cfg(feature = "feature1")] pub mod feature1 { fn func1() {} fn func2() {} fn func3() {} } // The following sub-module is only available under 'feature2' #[cfg(feature = "feature2")] pub mod feature2 { fn func4() {} fn func5() {} fn func6() {} }
} // Registered functions:
// func0 - always available
// func1 - available under 'feature1'
// func2 - available under 'feature1'
// func3 - available under 'feature1'
// func4 - available under 'feature2'
// func5 - available under 'feature2'
// func6 - available under 'feature2'
