The trick is to differentiate between multiple identical copies of Rhai, each having a different features set, by their sources : Different versions from crates.io - The official crate. Different releases from GitHub - Crate source on GitHub. Forked copy of https://github.com/jonathandturner/rhai on GitHub. Local copy of https://github.com/jonathandturner/rhai downloaded form GitHub. Use the following configuration in Cargo.toml to pull in multiple copies of Rhai within the same project: [dependencies]
rhai = { version = "0.20.0", features = [ "no_float" ] }
rhai_github = { git = "https://github.com/jonathandturner/rhai", features = [ "unchecked" ] }
rhai_my_github = { git = "https://github.com/my_github/rhai", branch = "variation1", features = [ "serde", "no_closure" ] }
rhai_local = { path = "../rhai_copy" } The example above creates four different modules: rhai, rhai_github, rhai_my_github and rhai_local, each referring to a different Rhai copy with the appropriate features set. Only one crate of any particular version can be used from each source, because Cargo merges all candidate cases within the same source, adding all features together. If more than four different instantiations of Rhai is necessary (why?), create more local repositories or GitHub forks or branches.

